sys_variable_value.value:
(function execute(inputs, outputs) {
var response =  JSON.parse(inputs.response);
var payload = response.value;  
payload.shift();  

gs.info(JSON.stringify(payload));

 var fields = {
    data: []
};

payload.map(function(item) {        
   fields.data.push({ 
        "name" : item.LogicalName,
        "label" : (typeof item.DisplayName.LocalizedLabels[0] == 'undefined' ? '': item.DisplayName.LocalizedLabels[0].Label),
        "value" : ""
    });
}); 
outputs.objectfields = fields;  

})(inputs, outputs);

